doc.solution:
The positive factors of $12$ are $1, 2, 3, 4, 6,$ and $12$. The negative factors of $12$ are $-1, -2, -3, -4, -6,$ and $-12$. When we add these twelve numbers together, we can pair each positive factor with its negation: \begin{align*}
[1+(-1)] + [2 + (-2)] + [3 + (-3)]& + [4 + (-4)] \\
{}+ [6 + (-6)] + [12 + (-12)] &= 0 + 0 + 0 + 0 + 0 + 0 \\
&= \boxed{0}.
\end{align*}

A Venn diagram is helpful in explaining the solution. Let an oval patch represent the set of students taking French and another oval represent those taking Spanish. In the diagram, observe that the intersection (overlap) of the two oval patches represents the set of students taking both French and Spanish (see region B). We begin by placing 3 xs in region B, representing the students taking both French and Spanish. Region A represents the set taking French alone. Since the totals in regions A and B must be 8, we place 5 xs in region A. Similarly we place 9 xs in region C. D represents the set taking neither French nor Spanish. In the second Venn diagram, each x represents a student. Observe that the total number of xs in regions A, B, and C is 17. Therefore D has $30-17=\boxed{13}$ students.

