 Let $d$ be the number of dogs and $c$ be the number of cats. Then $\frac{d}{c}=\frac{4}{3}$ and $d+c=280$. Solving the system of equations, we have
\begin{align*}
\frac{d}{c}&=\frac{4}{3}\\
\Rightarrow\qquad d&=\frac{4}{3}c\\
\Rightarrow\qquad \frac{4}{3}c+c&=280\\
\Rightarrow\qquad \frac{7}{3}c&=280\\
\Rightarrow\qquad c&=120\\
\Rightarrow\qquad d&=4c/3=4(120)/3=\boxed{160}.
\end{align*}
\end{example}

