Since the area of rectangle $PQRS$ is $24,$ let us assume that $PQ=6$ and $QR=4.$

Since $QT=TR,$ we have $QR=2QT$ so that $QT=2.$ [asy]
size(100);
draw((0,0)--(6,0)--(6,4)--(0,4)--cycle);
draw((0,4)--(6,2));
draw((5.8,1.1)--(6.2,1.1));
draw((5.8,.9)--(6.2,.9));
draw((5.8,3.1)--(6.2,3.1));
draw((5.8,2.9)--(6.2,2.9));
label("$P$",(0,4),NW);
label("$S$",(0,0),SW);
label("$R$",(6,0),SE);
label("$T$",(6,2),E);
label("$Q$",(6,4),NE);
label("6",(3,4),N);
label("2",(6,3),W);
label("2",(6,1),W);
[/asy] Therefore, triangle $PQT$ has base $PQ$ of length $6$ and height $QT$ of length $2,$ so has area $$\frac{1}{2}\cdot 6\cdot 2 = \frac{1}{2}\cdot 12 = 6.$$ So the area of quadrilateral $PTRS$ is equal to the area of rectangle $PQRS$ (which is $24$) minus the area of triangle $PQT$ (which is $6$), or $\boxed{18}.$

