  To find the mean, we need to add up all the scores and divide by the number of students.  We can do this by multiplying the number of students who scored each score by that score, and then adding up the results.  We then divide the sum by the total number of students to get the mean.

\begin{align*}
\text{Mean}&amp;=\frac{(20)(80)+(8)(90)+(2)(100)}{30}\\
&amp;=\frac{1600+720+200}{30}\\
&amp;=\frac{2520}{30}\\
&amp;=\boxed{84}
\end{align*}

Therefore, the class average on this test was 84.  Note that we could have also found the mean by adding up all the scores and dividing by 30, but this method is often faster and easier.  For example, if we had 100 students, it would be much easier to multiply the number of students who scored each score by that score and add up the results than it would be to add up all 100 scores.  This method is often referred to as the "weighted average" method.  It is a very useful method for finding the mean when there are many data

